description:
A collection of strange, beautiful stories covering the full spectrum of the late Roger Zelazny's remarkable talents in the fields of fantasy and science fiction.

The Doors of his face, the lamps of his mouth;
The Keys to December;
Devil Car;
A Rose for Ecclesiastes;
The Monster and the Maiden;
Collector's fever;
This mortal Mountain;
This Moment of the Storm;
The Great Slow Kings;
A Museum Piece;
Divine Madness;
Corrida;
Love is an imaginary Number;
The Man who loved the Faioli;
Lucifer
